import React, { useEffect, useState } from "react";

const images = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];

export const Carousel = () => {
  const [imagesIndex, setImagesIndex] = useState(0);

  const handlePrev = () => {
    if (imagesIndex === 0) {
      setImagesIndex(images.length - 1);
    } else {
      setImagesIndex(imagesIndex - 1);
    }
  };

  const handleNext = () => {
    if (imagesIndex === images.length - 1) {
      setImagesIndex(0);
    } else {
      setImagesIndex(imagesIndex + 1);
    }
  };

//   useEffect(() => {
//     const timer = setInterval(() => {
//       handleNext();
//     }, 1000);

//     return () => {
//       clearInterval(timer);
//     };
//   }, [imagesIndex]);

useEffect(() => {
    const timer = setInterval(() => {
      setImagesIndex((prevIndex) => (prevIndex === images.length - 1 ? 0 : prevIndex + 1));
    }, 1000);

    return () => {
      clearInterval(timer);
    };
  }, [images.length]);
  
  return (
    <div className="App">
      <h1>Carousel</h1>

      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <button onClick={handlePrev}>Prev</button>
        {/* <img
        src={images[imagesIndex]}
        alt="wallpapers"
        style={{ width: "200px", height: "200px" }}
      /> */}

        {/* using map for optimaization */}

        {images.map((url, index) => (
          <img
            key={index}
            src={url}
            alt="wallpapers"
            style={{
              width: "200px",
              height: "200px",
              display: imagesIndex === index ? "block" : "none",
            }}
          />
        ))}
        <button onClick={handleNext}>Next</button>
      </div>
      <hr />
    </div>
  );
};
